// function method is there" Hooks methods"
// number of hooks metyhods there
//1.useState()-------->similar to state---->state,setstate
//          state ---->intial informstion there ---->with in the component
// update----- setstate
// syntax------->
//             const[state,setstate]=useState() 
//2.useEffect()
//3.useContext()
//4.useRef()
// these are very importent(mejorly use)
    import {useState} from "react";     
    function Fnsignup() {
        const[information,setState]=useState("hello good morningb to all")
        const[value,setValue]=useState(0)
        const[data,setdata]=useState("")
        const[fname,setfname]=useState("")
        const[email,setemail]=useState("")
        const[password,setpassword]=useState("")
        const[cpassword,setcpassword]=useState("")
        
        
        
     
     
     
     
        const change=()=>{
        setState("harikrishna technologies")
        }   
        const increment=()=>{
            setValue(value+1)
        }
        const decrement=()=>{
            setValue(value-1)
        }
        const reset=()=>{
            setValue(0)
        }
        const print=(e)=>{
            setdata(e.target.value)
        }
        const ftname=(k)=>{
         setfname(k.target.value)
        }
        



        return(
                <div>
                     <p>{information}</p>
                    
                     <button onClick={change}>update</button>
                     <br></br>
                     <h3>value:{value}</h3>
                     <br></br>
                     <button onClick={increment}>increment</button>
                     <button onClick={decrement}>decrement</button>
                     <button onClick={reset}>reset</button>
                     <br></br>
                     <br></br>
                     <input type="text" onChange={print}/>
                     <br></br>
                     <h3>current value:{data}</h3>


                     <form onSubmit={formsubmit}>
                   <h2>sign up</h2>
                   <br></br>
                   <label>FULLNAME:</label>
                   <input value={fullname} required type="text" onChange={changefullname}/>
                   <br></br><br></br>
                   <label>EMAIL:</label>
                   <input value={email}required type="email" onChange={changeemail}/>
                   <br></br><br></br>
                   <label>PASSWORD:</label>
                   <input value={password} required type="password" onChange={changepass}/>
                   <br></br><br></br>
                   <label>CONFIRM PASSWORD:</label>
                   <input value={cpassword} required type="password"onChange={changeconfipass}/>
                    <br></br><br></br>
                    <input required type="submit" value="SIGN UP" onSubmit={this.formsubmit}/>

                      </form>

                      <form onSubmit={formsubmited}>
                   <h2>login</h2>
                   <br></br>
                   <label>FULL NAME:</label>
                   <input value={this.state.fullname} required type="text" onChange={this.changename}/>
                   <br></br><br></br>
                   <label>EMAIL:</label>
                   <input value={this.state.email}required type="email" onChange={this.changeemail}/>
                   <br></br><br></br>
                   <label>PASSWORD:</label>
                   <input value={this.state.pass} required type="password" onChange={this.changepas}/>
                   <br></br><br></br>
                   <label>CONFIRM PASSWORD:</label>
                   <input value={this.state.cpassword} required type="password"onChange={this.changeconfipass}/>
                    <br></br><br></br>
                    <input type="submit" value="LOGIN"/>

                      </form>    
                     
                </div>
            )
            
         }











export default Fnsignup;
